import React from "react";
import Mix from "../Mix";

const MixContainer = ({ stations }) => (
  <div>
    {stations.map((mixes) => (
      <section>
        <p>mix</p>
        {mixes.map((mix) => (
          <h2>{mix.name}</h2>
        ))}
        {/* <Mix mixes={mix} /> */}
      </section>
    ))}
  </div>
);

export default MixContainer;
